tiviteiten op papier te kunnen zetten. Je maakt zoveel mee in je leven. Dan is het verstandig om de leukste activiteiten nog eens na te kunnen lezen. Er gebeurt tenslotte zoveel in je leven, dat de helft niet meer in je directe geheugen zit. Het wordt wel een uitdaging om er tijd voor te maken, maar dat komt vast goed.\r\n\r\nIk ga jullie meenemen in de leuke momenten die ik mee maak, of dat nou een heerlijke hardloopochtend is in de zon door de duinen, of een ergernis van wat ik nou weer hoorde op de radio. Dit raakt allemaal wel het stadsleven aan. Ik woon in de grote stad achter de duinen. Het stadsleven is altijd een feest, of laat ik het anders zeggen. Er gebeurt áltijd iets in de stad. Marktjes, muziekavonden of het tegenwoordig veel voorkomende food evenementen. Geniet van de blog en laat je reactie achter in de reacties als jij er hetzelfde over denkt, of als je er een mening over hebt.','Mijn Allereerste Blog','','publish','open','open','','mijn-allereerste-blog','','','2017-04-24 09:16:12','2017-04-24 07:16:12','',0,'http://update.dev-atvise.nl/?p=106',0,'post','',0),(107,1,'2017-04-03 14:04:40','2017-04-03 12:04:40','<h2><strong>Mijn allereerste blog</strong></h2>\r\nHeerlijk om mijn ideeën en dagelijkse activiteiten op papier te kunnen zetten. Je maakt zoveel mee in je leven. Dan is het verstandig om de leukste activiteiten nog eens na te kunnen lezen. Er gebeurt tenslotte zoveel in je leven, dat de helft niet meer in je directe geheugen zit. Het wordt wel een uitdaging om er tijd voor te maken, maar dat komt vast goed.\r\n\r\nIk ga jullie meenemen in de leuke momenten die ik mee maak, of dat nou een heerlijke hardloopochtend is in de zon door de duinen, of een ergernis van wat ik nou weer hoorde op de radio. Dit raakt allemaal wel het stadsleven aan. Ik woon in de grote stad achter de duinen. Het stadsleven is altijd een feest, of laat ik het anders zeggen. Er gebeurt áltijd iets in de stad. Marktjes, muziekavonden of het tegenwoordig veel voorkomende food evenementen. Geniet van de blog en laat je reactie achter in de reacties als jij er hetzelfde over denkt, of als je er een mening over hebt.','Mijn Allereerste Blog','','inherit','closed','closed','','106-revision-v1','','','2017-04-03 14:04:40','2017-04-03 12:04:40','',106,'http://update.dev-atvise.nl/106-revision-v1/',0,'revision','',0),(108,1,'2017-04-03 14:20:03','2017-04-03 12:20:03','','Mijn eerste blog','','inherit','open','closed','','mijn-eerste-blog','','','2017-04-03 14:20:16','2017-04-03 12:20:16','',106,'http://update.dev-atvise.nl/wp-content/uploads/2017/04/mijn-eerste-blog.jpg',0,'attachment','image/jpeg',0),(109,1,'2017-04-03 14:23:05','2017-04-03 12:23:05','','Blog About life - Selfie','','inherit','open','closed','','myavatar','','','2017-04-03 14:23:26','2017-04-03 12:23:26','',0,'http://update.dev-atvise.nl/wp-content/uploads/2017/04/myAvatar.png',0,'attachment','image/png',0),(110,1,'2017-04-03 14:38:56','2017-04-03 12:38:56','<h2><strong>Italië – De stad van het voedsel</strong></h2>\r\nAfgelopen week een geweldige week gehad in Italië. In het plaatsje <a href=\"https://nl.wikipedia.org/wiki/Ventimiglia\" target=\"_blank\">Ventimiglia</a> in een Airbnb woning kunnen vertoeven. De zon scheen vol en de omgeving lag er mooi bij. Ventimiglia is een klein plaatsje in Noordwest Italië. Daar waar de zon – bijna – altijd schijnt. Er is al een beginvorm van toerisme te ontdekken, maar het valt nog mee. Zo kun je op bepaalde plekken nog steeds gratis parkeren, zijn de restaurantjes nog leuk en betaalbaar. Wij zijn meerdere keren naar de pizzeria geweest. Het gaat alleen niet zoals wij het hier in Nederland doen. In deze pizzeria mocht je drie soorten uitkiezen, waarna je deze pizza van één meter op tafel krijgt. Heel onhandig zou je zeggen, maar ze hebben hem op een verhoging gezet. Daardoor heb je nog alle ruimte voor je bord en extra’s. Je hebt natuurlijk nog plek nodig voor de fles wijn en bijbehorende glazen. Wijn is op de een of andere manier altijd lekkerder in het buitenland. Ook hier. Gelukkig hoefde ik niet altijd te rijden en kon ik me daardoor zo nu en dan laten gaan. Wellicht daarover later meer.\r\n\r\nJe ziet dat er enigszins toerisme begint te komen aan de bandjes, ’s avonds bij het strand. Spelen gemiddeld zo’n twee uur, maar het zorgt voor een goede sfeer en er is natuurlijk extra reden om wat langer aan het strand te hangen bij de restaurantjes of de plaatselijke bar. Het tweede voordeel van enige toerisme, is dat de ‘Gelataio’ wat langer open blijft. De ijscoman is tot ongeveer 1uur ’s nachts geopend! Volgende vakantie wordt New York, maar dat komt vanzelf.','Italië','','publish','open','open','','italie','','','2017-04-11 12:16:27','2017-04-11 10:16:27','',0,'http://update.dev-atvise.nl/?p=110',0,'post','',0),(111,1,'2017-04-03 14:38:10','2017-04-03 12:38:10','','Italië - De stad van het Voedsel (1)','','inherit','open','closed','','italie%cc%88-de-stad-van-het-voedsel-1','','','2017-04-03 14:38:15','2017-04-03 12:38:15','',110,'http://update.dev-atvise.nl/wp-content/uploads/2017/04/Italië-De-stad-van-het-Voedsel-1.jpg',0,'attachment','image/jpeg',0),(112,1,'2017-04-03 14:38:56','2017-04-03 12:38:56','<h2><strong>Italië – De stad van het voedsel</strong></h2>\r\nAfgelopen week een geweldige week gehad in Italië. In het plaatsje Ventimiglia in een Airbnb woning kunnen vertoeven. De zon scheen vol en de omgeving lag er mooi bij. Ventimiglia is een klein plaatsje in Noordwest Italië. Daar waar de zon – bijna – altijd schijnt. Er is al een beginvorm van toerisme te ontdekken, maar het valt nog mee. Zo kun je op bepaalde plekken nog steeds gratis parkeren, zijn de restaurantjes nog leuk en betaalbaar. Wij zijn meerdere keren naar de pizzeria geweest. Het gaat alleen niet zoals wij het hier in Nederland doen. In deze pizzeria mocht je drie soorten uitkiezen, waarna je deze pizza van één meter op tafel krijgt. Heel onhandig zou je zeggen, maar ze hebben hem op een verhoging gezet. Daardoor heb je