etten op bijvoorbeeld funda.nl, kijken wie er reageren met al een paar eerste indicaties om in te schatten of deze persoon geschikt kan zijn door middel van het jaarlijks bruto-inkomen, contractduur en een werkgeversverklaring. Wanneer dit door de eerste selectie heen komt, volgt er een bezichtiging met dat koppel. Vervolgens hebben zij dit eerste keus. Mocht zij afzien, dan komt er een ander koppel in aanmerking. Dit zorgt voor nauwelijks extra tijd, mits de foto’s en informatie dusdanig volledig is.\r\n\r\nZo zorg je er voor dat mocht iemand een huis bezichtigen, je er al zeker van bent dat – mocht iemand eerlijk zijn geweest – diegene het kan bekostigen. Dat zorgt er ook voor dat personen niet onnodig vrij nemen om een bezichtiging te doen, om vervolgens te horen dat het huurhuis naar een ander koppel is gegaan.\r\n\r\nIk vraag mij af of dit alleen in de grote stad is, of dat er meer mensen last hebben van deze praktijken. Chapeau voor makelaars die de bezichtigingen op de tweede manier uitvoeren.\r\n\r\nDe verhuizing heb ik laten doen bij <a href=\"http://www.vlaming.com\">Vlaming uit Amsterdam</a>. De nieuwe garagedeur komt van <a href=\"http://www.agara.nl\">Agara Garagedeuren uit Woerden</a>.','Verhuizen','','publish','open','open','','verhuizen','','','2017-06-28 13:27:30','2017-06-28 11:27:30','',0,'http://update.dev-atvise.nl/?p=113',0,'post','',0),(114,1,'2017-04-03 14:41:55','2017-04-03 12:41:55','<h2><strong>Italië – De stad van het voedsel</strong></h2>\r\nAfgelopen week een geweldige week gehad in Italië. In het plaatsje Ventimiglia in een Airbnb woning kunnen vertoeven. De zon scheen vol en de omgeving lag er mooi bij. Ventimiglia is een klein plaatsje in Noordwest Italië. Daar waar de zon – bijna – altijd schijnt. Er is al een beginvorm van toerisme te ontdekken, maar het valt nog mee. Zo kun je op bepaalde plekken nog steeds gratis parkeren, zijn de restaurantjes nog leuk en betaalbaar. Wij zijn meerdere keren naar de pizzeria geweest. Het gaat alleen niet zoals wij het hier in Nederland doen. In deze pizzeria mocht je drie soorten uitkiezen, waarna je deze pizza van één meter op tafel krijgt. Heel onhandig zou je zeggen, maar ze hebben hem op een verhoging gezet. Daardoor heb je nog alle ruimte voor je bord en extra’s. Je hebt natuurlijk nog plek nodig voor de fles wijn en bijbehorende glazen. Wijn is op de een of andere manier altijd lekkerder in het buitenland. Ook hier. Gelukkig hoefde ik niet altijd te rijden en kon ik me daardoor zo nu en dan laten gaan. Wellicht daarover later meer.\r\n\r\nJe ziet dat er enigszins toerisme begint te komen aan de bandjes, ’s avonds bij het strand. Spelen gemiddeld zo’n twee uur, maar het zorgt voor een goede sfeer en er is natuurlijk extra reden om wat langer aan het strand te hangen bij de restaurantjes of de plaatselijke bar. Het tweede voordeel van enige toerisme, is dat de ‘Gelataio’ wat langer open blijft. De ijscoman is tot ongeveer 1uur ’s nachts geopend! Volgende vakantie wordt New York, maar dat komt vanzelf.','Italië','','inherit','closed','closed','','110-revision-v1','','','2017-04-03 14:41:55','2017-04-03 12:41:55','',110,'http://update.dev-atvise.nl/110-revision-v1/',0,'revision','',0),(115,1,'2017-04-03 14:53:38','2017-04-03 12:53:38','','Verhuizen - Blog About Life','','inherit','open','closed','','verhuizen-blog-about-life','','','2017-04-03 14:53:47','2017-04-03 12:53:47','',113,'http://update.dev-atvise.nl/wp-content/uploads/2017/04/verhuizen-Blog-About-Life.jpg',0,'attachment','image/jpeg',0),(116,1,'2017-04-03 14:54:44','2017-04-03 12:54:44','<h2><strong>Verhuizen – in de grote stad</strong></h2>\r\nDoor omstandigheden ben ik genoodzaakt om te verhuizen voor eind april. Op zich geen ramp, een nieuwe woning, een nieuwe uitdaging. Zo nu en dan veranderingen in je leven houdt je alleen maar scherp. Buiten dat moet je capabel zijn om je aan te passen aan nieuwe omstandigheden. Op lange termijn zal het vast wel ergens goed voor zijn is mijn gedachte in dit soort situaties.\r\n\r\nHet probleem begint echter bij het bezichtigen van huizen in de stad die in jouw salarisklasse liggen. Particuliere woning zijn vrij eenvoudig te vinden. De verhouding tussen vraag en aanbod is echter zoek. Als er een woning is die er al enigszins goed uitziet, komen er gemiddeld tien koppels langs. Dit frustreert behoorlijk. Aangezien bezichtigingen tijdens kantooruren zijn, moet er dus sowieso vrij worden genomen van werk. Ik ben wat dat betreft meer voor een omgekeerde volgorde. Na het online zetten op bijvoorbeeld funda.nl, kijken wie er reageren met al een paar eerste indicaties om in te schatten of deze persoon geschikt kan zijn door middel van het jaarlijks bruto-inkomen, contractduur en een werkgeversverklaring. Wanneer dit door de eerste selectie heen komt, volgt er een bezichtiging met dat koppel. Vervolgens hebben zij dit eerste keus. Mocht zij afzien, dan komt er een ander koppel in aanmerking. Dit zorgt voor nauwelijks extra tijd, mits de foto’s en informatie dusdanig volledig is.\r\n\r\nZo zorg je er voor dat mocht iemand een huis bezichtigen, je er al zeker van bent dat – mocht iemand eerlijk zijn geweest – diegene het kan bekostigen. Dat zorgt er ook voor dat personen niet onnodig vrij nemen om een bezichtiging te doen, om vervolgens te horen dat het huurhuis naar een ander koppel is gegaan.\r\n\r\nIk vraag mij af of dit alleen in de grote stad is, of dat er meer mensen last hebben van deze praktijken. Chapeau voor makelaars die de bezichtigingen op de tweede manier uitvoeren.','Verhuizen','','inherit','closed','closed','','113-revision-v1','','','2017-04-03 14:54:44','2017-04-03 12:54:44','',113,'http://update.dev-atvise.nl/113-revision-v1/',0,'revision','',0),(117,1,'2017-04-03 15:14:01','2017-04-03 13:14:01','','Welkom','','inherit','closed','closed','','10-revision-v1','','','2017-04-03 15:14:01','2017-04-03 13:14:01','',10,'http://update.dev-atvise.nl/10-revision-v1/',0,'revision','',0),(131,1,'2017-04-03 15:36:38','20