jn de restaurantjes nog leuk en betaalbaar. Wij zijn meerdere keren naar de pizzeria geweest. Het gaat alleen niet zoals wij het hier in Nederland doen. In deze pizzeria mocht je drie soorten uitkiezen, waarna je deze pizza van één meter op tafel krijgt. Heel onhandig zou je zeggen, maar ze hebben hem op een verhoging gezet. Daardoor heb je nog alle ruimte voor je bord en extra’s. Je hebt natuurlijk nog plek nodig voor de fles wijn en bijbehorende glazen. Wijn is op de een of andere manier altijd lekkerder in het buitenland. Ook hier. Gelukkig hoefde ik niet altijd te rijden en kon ik me daardoor zo nu en dan laten gaan. Wellicht daarover later meer.\r\n\r\nJe ziet dat er enigszins toerisme begint te komen aan de bandjes, ’s avonds bij het strand. Spelen gemiddeld zo’n twee uur, maar het zorgt voor een goede sfeer en er is natuurlijk extra reden om wat langer aan het strand te hangen bij de restaurantjes of de plaatselijke bar. Het tweede voordeel van enige toerisme, is dat de ‘Gelataio’ wat langer open blijft. De ijscoman is tot ongeveer 1uur ’s nachts geopend! Volgende vakantie wordt New York, maar dat komt vanzelf.','Italië','','inherit','closed','closed','','110-revision-v1','','','2017-04-11 12:16:27','2017-04-11 10:16:27','',110,'http://update.dev-atvise.nl/110-revision-v1/',0,'revision','',0),(159,1,'2017-04-11 12:27:28','2017-04-11 10:27:28',' ','','','publish','closed','closed','','159','','','2018-03-05 11:07:18','2018-03-05 10:07:18','',0,'http://update.dev-atvise.nl/?p=159',4,'nav_menu_item','',0),(162,1,'2018-08-23 13:55:14','2018-08-23 11:55:14','<h1>Links aanraders!</h1>\n\n<hr />\n\n<a title=\"Waterontharders\" href=\"https://www.remon-waterontarders.nl\" target=\"_blank\" rel=\"noopener\">Waterontharder</a>\n\n<hr />\n\n<a title=\"Prijs waterontharder\" href=\"https://www.remon-waterontharders.nl/prijs-waterontharder/\" target=\"_blank\" rel=\"noopener\">Prijs Waterontharder</a>\n\n<hr />\n\n<a href=\"https://www.grondverzet-info.nl\" title=\"Grondv