pgetreden bij het versturen van het bericht. Probeer later nog een keer.\nEen of meer velden bevatten een fout. Graag corrigeren en opnieuw proberen.\nEr is een fout opgetreden bij het versturen van het bericht. Probeer later nog een keer.\nJe moet de voorwaarden accepteren voordat je het bericht kunt verzenden.\nHet veld is verplicht.\nHet veld is te lang.\nHet veld is te kort.\nDe datumnotatie is incorrect.\nDe ingevulde datum is voor de eerst mogelijke datum.\nDe ingevulde datum is na de laatst mogelijke datum.\nEr is een onbekende fout opgetreden bij het uploaden van het bestand.\nHet is niet toegestaan om een bestand met dit bestandstype te uploaden.\nHet bestand is te groot.\nEr is een fout opgetreden bij het uploaden van het bestand.\nDit nummer formaat is ongeldig.\nHet ingevulde nummer is kleiner dan het laagst mogelijke nummer toegestaan.\nHet ingevulde nummer is groter dan het hoogst mogelijke nummer toegestaan.\nHet antwoord op de quiz is niet correct.\nDe ingevulde code is onjuist.\nHet ingevoerde e-mailadres is onjuist.\nDe URL is ongeldig.\nHet telefoonnummer is ongeldig.','Contact','','publish','closed','closed','','contact','','','2018-03-05 11:05:37','2018-03-05 10:05:37','',0,'http://update.dev-atvise.nl/?post_type=wpcf7_contact_form&#038;p=333',0,'wpcf7_contact_form','',0),(334,1,'2017-06-23 12:23:22','2017-06-23 10:23:22','[vc_row][vc_column][vc_column_text]\r\n<h1>Contactformulier</h1>\r\nLaat hieronder uw gegevens achter en wij nemen spoedig contact met u op.\r\n[contact-form-7 id=\"151\" title=\"contact\"][/vc_column_text][/vc_column][/vc_row]','Contact','','inherit','closed','closed','','9-revision-v1','','','2017-06-23 12:23:22','2017-06-23 10:23:22','',9,'http://update.dev-atvise.nl/blog/2017/06/23/9-revision-v1/',0,'revision','',0),(335,1,'2017-06-23 12:28:33','2017-06-23 10:28:33','Wij nemen spoedig contact met u op.','Bedankt','','publish','closed','closed','','bedankt','','','2018-03-05 11:08:18','2018-03-05 10:08:18','',0,'http://upda