 volledig gemeten, vervolgens de gipsplaat uitgesneden. Om er vervolgens achter te komen dat-ie niet past. Meerdere keren niet. Ons een groot raadsel. Bleek dat we twee verschillende meetapparatuur hadden gebruikt. Waar blijkbaar verschil in zat. Het deed mij een beetje hieraan denken:\r\n\r\n<iframe src=\"https://www.youtube.com/embed/wYXczKhpsJA\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>','Helpen Verhuizen','','publish','open','open','','helpen-verhuizen','','','2017-06-27 15:27:02','2017-06-27 13:27:02','',0,'http://update.dev-atvise.nl/?p=343',0,'post','',0),(344,1,'2017-06-27 15:26:25','2017-06-27 13:26:25','Familie van mij is aan het verhuizen. En als goede familie betaamt, help je dan uiteraard mee. De gipsplaten moesten worden opgehangen, over het isolatiemateriaal heen. Dit moest in bepaalde afmetingen. Dat hebben we volledig gemeten, vervolgens de gipsplaat uitgesneden. Om er vervolgens achter te komen dat-ie niet past. Meerdere keren niet. Ons een groot raadsel. Bleek dat we twee verschillende meetapparatuur hadden gebruikt. Waar blijkbaar verschil in zat. Het deed mij een beetje hieraan denken:\r\n\r\n<iframe src=\"https://www.youtube.com/embed/wYXczKhpsJA\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>','Helpen Verhuizen','','inherit','closed','closed','','343-revision-v1','','','2017-06-27 15:26:25','2017-06-27 13:26:25','',343,'http://update.dev-atvise.nl/343-revision-v1/',0,'revision','',0),(345,1,'2017-06-28 13:27:22','2017-06-28 11:27:22','<h2><strong>Verhuizen – in de grote stad</strong></h2>\nDoor omstandigheden ben ik genoodzaakt om te verhuizen voor eind april. Op zich geen ramp, een nieuwe woning, een nieuwe uitdaging. Zo nu en dan veranderingen in je leven houdt je alleen maar scherp. Buiten dat moet je capabel zijn om je aan te passen aan nieuwe omstandigheden. Op lange termijn zal het vast wel ergens goed voor zijn is mijn gedachte in dit soort situaties.\n\nHet probleem begint echter bij het bezichtigen van huizen in de stad die in jouw salarisklasse liggen. Particuliere woning zijn vrij eenvoudig te vinden. De verhouding tussen vraag en aanbod is echter zoek. Als er een woning is die er al enigszins goed uitziet, komen er gemiddeld tien koppels langs. Dit frustreert behoorlijk. Aangezien bezichtigingen tijdens kantooruren zijn, moet er dus sowieso vrij worden genomen van werk. Ik ben wat dat betreft meer voor een omgekeerde volgorde. Na het online zetten op bijvoorbeeld funda.nl, kijken wie er reageren met al een paar eerste indicaties om in te schatten of deze persoon geschikt kan zijn door middel van het jaarlijks bruto-inkomen, contractduur en een werkgeversverklaring. Wanneer dit door de eerste selectie heen komt, volgt er een bezichtiging met dat koppel. Vervolgens hebben zij dit eerste keus. Mocht zij afzien, dan komt er een ander koppel in aanmerking. Dit zorgt voor nauwelijks extra tijd, mits de foto’s en informatie dusdanig volledig is.\n\nZo zorg je er voor dat mocht iemand een huis bezichtigen, je er al zeker van bent dat – mocht iemand eerlijk zijn geweest – diegene het kan bekostigen. Dat zorgt er ook voor dat personen niet onnodig vrij nemen om een bezichtiging te doen, om vervolgens te horen dat het huurhuis naar een ander koppel is gegaan.\n\nIk vraag mij af of dit alleen in de grote stad is, of dat er meer mensen last hebben van deze praktijken. Chapeau voor makelaars die de bezichtigingen op de tweede manier uitvoeren.\n\nDe verhuizing heb ik laten doen bij <a href=\"http://www.vlaming.com\">Vlaming uit Amsterdam</a>. De nieuwe garagedeur komt van Agara Garagedeuren uit Woerden.','Verhuizen','','inherit','closed','closed','','113-autosave-v1','','','2017-06-28 13:27:22','2017-06-28 11:27:22','',113,'http://update.dev-atvise.nl/113-autosave-v1/',0,'revision','',0),(346,1,'2017-06-28 13:27:30','2017-06-28 11:27:30','<h2><strong>Verhuizen – in de grote stad</strong></h2>\r\nDoor omstandigheden ben ik genoodzaakt om te verhuizen voor eind april. Op zich geen ramp, een nieuwe woning, een nieuwe uitdaging. Zo nu en dan veranderingen in je leven houdt je alleen maar scherp. Buiten dat moet je capabel zijn om je aan te passen aan nieuwe omstandigheden. Op lange termijn zal het vast wel ergens goed voor zijn is mijn gedachte in dit soort situaties.\r\n\r\nHet probleem begint echter bij het bezichtigen van huizen in de stad die in jouw salarisklasse liggen. Particuliere woning zijn vrij eenvoudig te vinden. De verhouding tussen vraag en aanbod is echter zoek. Als er een woning is die er al enigszins goed uitziet, komen er gemiddeld tien koppels langs. Dit frustreert behoorlijk. Aangezien bezichtigingen tijdens kantooruren zijn, moet er dus sowieso vrij worden genomen van werk. Ik ben wat dat betreft meer voor een omgekeerde volgorde. Na het online zetten op bijvoorbeeld funda.nl, kijken wie er reageren met al een paar eerste indicaties om in te schatten of deze persoon geschikt kan zijn door middel van het jaarlijks bruto-inkomen, contractduur en een werkgeversverklaring. Wanneer dit door de eerste selectie heen komt, volgt er een bezichtiging met dat koppel. Vervolgens hebben zij dit eerste keus. Mocht zij afzien, dan komt er een ander koppel in aanmerking. Dit zorgt voor nauwelijks extra tijd, mits de foto’s en informatie dusdanig volledig is.\r\n\r\nZo zorg je er voor dat mocht iemand een huis bezichtigen, je er al zeker van bent dat – mocht iemand eerlijk zijn geweest – diegene het kan bekostigen. Dat zorgt er ook voor dat personen niet onnodig vrij nemen om een bezichtiging te doen, om vervolgens te horen dat het huurhuis naar een ander koppel is gegaan.\r\n\r\nIk vraag mij af of dit alleen in de grote stad is, of dat er meer mensen last hebben van deze praktijken. Chapeau voor makelaars die de bezichtigingen op de tweede manier uitvoeren.\r\n\r\nDe verhuizing heb ik laten doen bij <a href=\"http://www.vlaming.com\">Vlaming uit Amsterdam</a>. De nieuwe garagedeur komt van <a href=\"http://www.agara.nl\">Agara Garagedeuren uit Woerden</a>.','Verhuizen','','inherit','closed','closed','','113-revision-v1','','','2017-06-28 13:27:30','2017-06-28 11:27:30','',113,'http://update.dev-atvise.nl/113-revision-v1/',0,'revision','',0),(349,1,'2017-07-18 13:32:17','2017-07-18 11:32:17','<h2>Meerderheid Nederlanders laat ongebruikte kleding in de kast hangen</h2>\r\n<strong>Bijna 70% van de Nederlanders geeft aan tussen de 5 en ruim 20 ongedragen kledingstukken in de kast te laten hangen. Wordt de kleding alsnog weggedaan dan is dit omdat het niet meer past (62,7%), omdat het überhaupt nooit gedragen wordt (54,7%) of omdat de kleding kapot of versleten is (50,4%)*, zo blijkt uit onderzoek van onderzoeksbureau Kien naar houding en gedrag van 1200 Nederlandse consumenten ten opzichte van kledingrecycling.</strong>\r\n\r\n<a href=\"http://update.dev-atvise.nl/wp-content/uploads/2017/07/Packmee-concept-infographic-groot.png\"><img class=\"alignnone wp-image-351 size-medium\" src=\"http://update.dev-atvise.nl/wp-content/uploads/2017/07/Packmee-concept-infographic-groot-300x179.png\" alt=\"\" width=\"300\" height=\"179\" /></a>\r\n\r\n<strong>Kledinginzameling aan huis voor het goede doel.</strong>\r\nOm het weggooien van gebruikte, maar nog bruikbare kleding tegen te gaan werd Packmee ontwikkeld. Met Packmee kan alle bruikbare kleding, textiel en schoeisel gratis door de donateur worden meegegeven aan een pakketbezorger van PostNL. Daarnaast kan de doos met kleding ook gratis bij een van de 2600 postkantoren van PostNL worden afgegeven. Minimaal 50% van de opbrengst komt ten goede aan <a href=\"https://www.packmee.nl/Goede-doelen/KiKa\">KiKa</a>, die fondsen werft voor onderzoek op het gebied van kinderkanker en <a href=\"https://www.packmee.nl/Goede-doelen/Stichting-Kinderpostzegels\">Stichting Kinderpostzegels Nederland</a>. Laatstgenoemde is onder meer bekend van de jaarlijkse Kinderpostzegelactie. Waarmee geld wordt opgehaald voor wereldwijde projecten waarin de veiligheid en ontwikkeling van kinderen centraal staan.\r\n<h3>Wat is  Packmee?</h3>\r\n<iframe src=\"https://www.youtube.com/embed/jH5XUpc_uAs\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>\r\n<h3>Kledinginzameling 2.0</h3>\r\nDoor de toenemende kosten die gemeentes in rekening brengen aan inzamelaars van kleding, staat de opbrengst van de huidige <a href=\"https://www.packmee.nl/kledinginzameling/Kledinginzameling-per-post\">kledinginzameling</a> onder druk. Packmee maakt gebruik van het bestaande en fijnmazige netwerk van PostNL. Er rijden dus geen extra auto’s om kleding in te zamelen. Dit scheelt op jaarbasis heel veel aan CO2 uitstoot.\r\n<h3>Hoe werkt het?</h3>\r\nVoor het versturen van de kleding kan iedere grote doos worden gebruikt. Op de website van Packmee staat een verzendlabel dat kan worden uitgeprint. Daarnaast kan ook met een zwarte stift het gratis antwoordnummer van Packmee op de doos worden geschreven (Packmee, Antwoordnummer 7, 2740 VG, Waddinxveen). Meer informatie over Packmee en de samenwerking met Kika, Stichting Kinderpostzegels Nederland en PostNL is te vinden op <a href=\"https://www.packmee.nl\">www.packmee.nl</a>','Packmee Concept','','publish','open','open','','packmee-concept','','','2017-07-18 13:32:17','2017-07-18 11:32:17','',0,'http://update.dev-atvise.nl/?p=349',0,'post','',0),(350,1,'2017-07-18 12:32:00','2017-07-18 10:32:00','','Packmee-concept','','inherit','open','closed','','packmee-concept','','','2017-07-18 12:32:00','2017-07-18 10:32:00','',349,'http://update.dev-atvise.nl/wp-content/uploads/2017/07/Packmee-concept.jpg',0,'attachment','image/jpeg',0),(351,1,'2017-07-18 12:38:50','2017-07-18 10:38:50','','Packmee-concept-infographic-groot','','inherit','open','closed','','packmee-concept-infographic-groot','','','2017-07-18 12:38:50','2017-07-18 10:38:50','',349,'http://update.dev-atvise.nl/wp-content/uploads/2017/07/Packmee-concept-infographic-groot.png',0,'attachment','image/png',0),(352,1,'2017-07-18 12:38:52','2017-07-18 10:38:52','','Packmee-concept-infographic','','inherit','open','closed','','packmee-concept-infographic','','','2017-07-18 12:38:52','2017-07-18 10:38:52','',349,'http://update.dev-atvise.nl/wp-content/uploads/2017/07/Packmee-concept-infographic.jpg',0,'attachment','image/jpeg',0),(353,1,'2017-07-18 13:24:18','2017-07-18 11:24:18','<h2>Meerderheid Nederlanders laat ongebruikte kleding in de kast hangen</h2>\r\n<strong>Bijna 70% van de Nederlanders geeft aan tussen de 5 en ruim 20 ongedragen kledingstukken in de kast te laten hangen. Wordt de kleding alsnog weggedaan dan is dit omdat het niet meer past (62,7%), omdat het überhaupt nooit gedragen wordt (54,7%) of omdat de kleding kapot of versleten is (50,4%)*, zo blijkt uit onderzoek van onderzoeksbureau Kien naar houding en gedrag van 1200 Nederlandse consumenten ten opzichte van kledingrecycling.</strong>\r\n\r\n<a href=\"http://update.dev-atvise.nl/wp-content/uploads/2017/07/Packmee-concept-infographic-groot.png\"><img class=\"alignnone wp-image-351 size-medium\" src=\"http://update.dev-atvise.nl/wp-content/uploads/2017/07/Packmee-concept-infographic-groot-300x179.png\" alt=\"\" width=\"300\" height=\"179\" /></a>\r\n\r\n<strong>Kledinginzameling aan huis voor het goede doel.</strong>\r\nOm het weggooien van gebruikte, maar nog bruikbare kleding tegen te gaan werd Packmee ontwikkeld. Met Packmee kan alle bruikbare kleding, textiel en schoeisel gratis door de donateur worden meegegeven aan een pakketbezorger van PostNL. Daarnaast kan de doos met kleding ook gratis bij een van de 2600 postkantoren van PostNL worden afgegeven. Minimaal 50% van de opbrengst komt ten goede aan <a href=\"https://www.packmee.nl/Goede-doelen/KiKa\">KiKa</a>, die fondsen werft voor onderzoek op het gebied van kinderkanker en <a href=\"https://www.packmee.nl/Goede-doelen/Stichting-Kinderpostzegels\">Stichting Kinderpostzegels Nederland</a>. Laatstgenoemde is onder meer bekend van de jaarlijkse Kinderpostzegelactie. Waarmee geld wordt opgehaald voor wereldwijde projecten waarin de veiligheid en ontwikkeling van kinderen centraal staan.\r\n<h3>Wat is  Packmee?</h3>\r\n<iframe src=\"https://www.youtube.com/embed/jH5XUpc_uAs\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe>\r\n<h3>Kledinginzameling 2.0</h3>\r\nDoor de toenemende kosten die gemeentes in rekening brengen aan inzamelaars van kleding, staat de opbrengst van de huidige <a href=\"https://www.packmee.nl/kledinginzameling/Kledinginzameling-per-post\">kledinginzameling</a> onder druk. Packmee maakt gebruik van het bestaande en fijnmazige netwerk van PostNL. Er rijden dus geen extra auto’s om kleding in te zamelen. Dit scheelt op jaarbasis heel veel aan CO2 uitstoot.\r\n<h3>Hoe werkt het?</h3>\r\nVoor het versturen van de kleding kan iedere grote doos worden gebruikt. Op de website van Packmee staat een verzendlabel dat kan worden uitgeprint. Daarnaast kan ook met een zwarte stift het gratis antwoordnummer van Packmee op de doos worden geschreven (Packmee, Antwoordnummer 7, 2740 VG, Waddinxveen). Meer informatie over Packmee en de samenwerking met Kika, Stichting Kinderpostzegels Nederland en PostNL is te vinden op <a href=\"https://www.packmee.nl\">www.packmee.nl</a>','Packmee Concept','','inherit','closed','closed','','349-revision-v1','','','2017-07-18 13:24:18','2017-07-18 11:24:18','',349,'http://update.dev-atvise.nl/349-revision-v1/',0,'revision','',0),(354,1,'2017-07-18 15:05:16','2017-07-18 13:05:16','<strong>Vorige week ben ik via een maatje in aanraking gekomen met Packmee. En daar zou ik graag de loftrompet voor willen steken.</strong>\r\n\r\nEen paar jaar geleden hebben we met een vriendengroep besloten om ons wat beter in te gaan zetten voor het goede doel. Brachten we regelmatig kleding naar kringloopwinkels, of gaven we kleding mee aan vrienden, familie of kennissen die naar derdewereldlanden gingen. Dit gaf ons een goed gevoel. Het idee dat je andere kinderen blij kunt maken met kleding die je zelf toch niet meer draagt. Dit is voor meerdere partijen een win-win-situatie. Zo is er in de loop der tijd kleding gebracht naar Azië, Afrika en Zuid-Amerika. In totaal naar 6 landen als ik het mij goed kan herinneren.\r\n\r\nNu we allemaal ouder zijn en een baan hebben, komt het er minder van om dit project op deze wijze door te zetten. Steeds minder mensen uit onze kennissenkring vertrekt naar derdewereldlanden. Om ons toch nog in te zetten voor het goede doel en omdat we toch nog elk jaar kleding en schoenen overhebben die wij niet gebruiken, hebben we besloten om hier wat anders mee te doen. We ontdekte het <a href=\"https://www.packmee.nl/\" target=\"_blank\" rel=\"noopener\">Packmee concept</a>. Packmee is een bedrijf dat tweedehands kleding en schoenen verzamelt. Zij kunnen de stof weer doorverkopen en schenken een gedeelte van de opbrengst aan Kika en Stichtingkinderpostzegels Nederland. Je kunt ze de tweedehandskleding kosteloos doorsturen via de post.\r\n\r\nHet brengt ons een lach op het gezicht als we weer een volle tas op kunnen sturen. Aangezien we ons verhaal in de loop der tijd aan viel vrienden en familie hebben verteld, ontvangen we van alle hoeken kleding om vervolgens weer naar Packmee door te sturen.\r\n\r\nMocht je naar aanleiding van dit bericht geïnspireerd zijn om ook kleding te doneren. Kijk dan op <a href=\"https://www.packmee.nl\" target=\"_blank\" rel=\"noopener\">www.packmee.nl</a>\r\n\r\n<sup><em>Lees het volledige verhaal over Packmee <a href=\"http://update.dev-atvise.nl/packmee-concept/\" target=\"_blank\" rel=\"noopener\">hier</a></em></sup>','Kleding doneren','','publish','open','open','','kleding-doneren','','\nhttp://blogaboutlife.nl/packmee-concept/','2017-07-18 15:34:31','2017-07-18 13:34:31','',0,'http://update.dev-atvise.nl/?p=354',0,'post','',0),(355,1,'2017-07-18 15:05:16','2017-07-18 13:05:16','<strong>Vorige week ben ik via e