t feest met vrienden en familie. En een vader die met pensioen kan en dit ook gedeeltelijk gaat doen. Feestjes zijn mooi. En moeten gevierd worden. Wellicht maak ik er wel een feest blog van!\n\n[kkstarratings]','Feestje!','','inherit','closed','closed','','362-autosave-v1','','','2018-06-29 08:48:03','2018-06-29 06:48:03','',362,'http://update.dev-atvise.nl/362-autosave-v1/',0,'revision','',0),(366,1,'2017-08-04 16:04:04','2017-08-04 14:04:04','','feesten','','inherit','open','closed','','feesten','','','2017-08-04 16:04:08','2017-08-04 14:04:08','',362,'http://update.dev-atvise.nl/wp-content/uploads/2017/08/feesten.jpg',0,'attachment','image/jpeg',0),(367,1,'2017-08-04 16:04:11','2017-08-04 14:04:11','<em>Hiep hiep hoera! Afgelopen week was er een feestje te vieren. Hoewel ik vind dat je je verjaardag en andere bijzonderheden altijd wel mag vieren. Bijzonderheden zoals diploma\'s, contract verlengingen, salarisverhoging, nieuwe baan, nieuwe woning, zoveel jaar een relatie, zoveel jaar bevriend, je kat die weer een mensen-jaar ouder is, met andere woorden: Alles moet eigenlijk gevierd worden wanneer de mogelijkheid daar is. Maar, (vandaar de \'hoewel\' in de derde zin) sommige situaties zijn zó bijzonder. Die verdienen dan extra aandacht. Zo ook deze situatie.</em>\r\n\r\n&nbsp;','Feestje!','','inherit','closed','closed','','362-revision-v1','','','2017-08-04 16:04:11','2017-08-04 14:04:11','',362,'http://update.dev-atvise.nl/362-revision-v1/',0,'revision','',0),(368,1,'2017-08-04 16:12:32','2017-08-04 14:12:32','','feest','','inherit','open','closed','','feest-2','','','2017-08-04 16:12:35','2017-08-04 14:12:35','',362,'http://update.dev-atvise.nl/wp-content/uploads/2017/08/feest-1.jpg',0,'attachment','image/jpeg',0),(369,1,'2017-08-04 16:13:09','2017-08-04 14:13:09','<strong>Hiep hiep hoera! Hoewel ik vind dat je je verjaardag en andere bijzonderheden altijd wel mag vieren. Bijzonderheden zoals diploma\'s, contract verlengingen, salarisverhoging, nieuwe baan, nie