eling dat wij zouden gaan koken. Daardoor was er een cateringpartij die voor ons het eten verzorgde. De jongeren werden bovendien met andere lekkernijen verwend. WE gingen een <a href=\"https://www.eatdutchwaffles.nl/Stroopwafelkraam-huren\" target=\"_blank\" rel=\"noopener\">stroopwafelkraam huren</a> bij <a href=\"https://www.eatdutchwaffles.nl\" target=\"_blank\" rel=\"noopener\">EatDutchWaffles</a> en we gingen een <a href=\"http://www.dutchfoodconcepts.nl/poffertjeskraam-huren\" target=\"_blank\" rel=\"noopener\">poffertjeskraam huren</a> bij <a href=\"http://www.dutchfoodconcepts.nl/\" target=\"_blank\" rel=\"noopener\">Dutch Food Concepts</a>. Ideaal voor dit soort partijen. Aangezien we het in de middag vierde was iedereen op deze manier voorzien.\r\n\r\nDit feest doen we niet snel weer over. Maar voor deze keer was het een super ervaring. Een groot feest met vrienden en familie. En een vader die met pensioen kan en dit ook gedeeltelijk gaat doen. Feestjes zijn mooi. En moeten gevierd worden. Wellicht maak ik er wel een feest blog van!\r\n\r\n[kkstarratings]','Feestje!','','inherit','closed','closed','','362-revision-v1','','','2017-08-15 14:41:10','2017-08-15 12:41:10','',362,'http://update.dev-atvise.nl/362-revision-v1/',0,'revision','',0),(387,1,'2018-03-05 11:01:17','2018-03-05 10:01:17','tjerk@atvise.nl\nAtvise','tjerk@atvise.nl','','publish','closed','closed','','tjerk-atvise-nl','','','2018-03-05 11:01:17','2018-03-05 10:01:17','',0,'http://update.dev-atvise.nl/tjerk-atvise-nl/',0,'flamingo_contact','',0),(388,1,'2018-03-05 11:06:27','2018-03-05 10:06:27','','Contact','','publish','closed','closed','','contact','','','2018-03-05 11:06:27','2018-03-05 10:06:27','',0,'http://update.dev-atvise.nl/?p=388',4,'nav_menu_item','',0),(389,1,'2018-03-05 11:07:18','2018-03-05 10:07:18','','Contact','','publish','closed','closed','','contact-2','','','2018-03-05 11:07:18','2018-03-05 10:07:18','',0,'http://update.dev-atvise.nl/?p=389',5,'nav_menu_item','',0),(390,0,'2018-03-05 11:07:58','2018-03-05 10:07:58','tjerk_t@hotmail.com\n[your-name]','tjerk_t@hotmail.com','','publish','closed','closed','','tjerk_t-hotmail-com','','','2018-03-05 11:07:58','2018-03-05 10:07:58','',0,'http://update.dev-atvise.nl/?post_type=flamingo_contact&p=390',0,'flamingo_contact','',0),(391,0,'2018-03-05 11:07:58','2018-03-05 10:07:58','Tjerk\nTriep\ntjerk_t@hotmail.com\nTesttttt 2\netestetew\ntewtewesfsdfdsf','etestetew','','publish','closed','closed','','etestetew','','','2018-03-05 11:07:58','2018-03-05 10:07:58','',0,'http://update.dev-atvise.nl/?post_type=flamingo_inbound&p=391',0,'flamingo_inbound','',0),(392,1,'2018-03-05 11:08:18','2018-03-05 10:08:18','Wij nemen spoedig contact met u op.','Bedankt','','inherit','closed','closed','','335-revision-v1','','','2018-03-05 11:08:18','2018-03-05 10:08:18','',335,'http://update.dev-atvise.nl/335-revision-v1/',0,'revision','',0),(433,1,'2018-06-19 14:02:33','2018-06-19 12:02:33','<strong>Gelukkig ben ik bevoorrecht met het feit nog in het bezit te zijn van twee grootmoeders. Alhoewel ze beiden in het volgende decennium 100 zullen worden, wonen ze nog zelfstandig. Een van mijn twee oma’s moet helaas noodgedwongen haar huisje verlaten en verhuizen naar een ander onderkomen. Bij een nieuw huis, hoort natuurlijk ook een nieuwe inrichting moet ze gedacht hebben.</strong>\r\n\r\nVorige week wilde oma dan ook samen met mij en mijn moeder op “meubeljacht”. Omdat zij niet meer zo goed ter been is, besloten wij wat interieurwinkels dichtbij te bezoeken. Kwaliteit en exclusiviteit vindt zij nog steeds er belangrijk. De eerste winkel die wij daarom bezochten was <a href=\"https://www.empelcollections.com/\" target=\"_blank\" rel=\"noopener\">Empel Collections</a> en het was voor haar onmiddellijk raak!\r\n\r\nEen compleet nieuwe inrichting werd aangeschaft. Zo werden er nieuwe <a href=\"https://www.empelcollections.com/nl/meubels-&amp;-decoraties/meubels-en-decoraties/zitmeubels\" target=\"_blank\" rel=\"noopener\">zitmeubels</a> besteld. Een tweezitsbank en daarbij twee passende fauteuils. Oma was er direct helemaal weg van! Deze bank zit heerlijk zei ze.\r\n\r\nOmdat het nieuwe huis veel minder ramen bevat dan haar oude huis, wilde oma ook nog wat <a href=\"https://www.empelcollections.com/nl/verlichting\" target=\"_blank\" rel=\"noopener\">verlichting</a> hebben. Een nieuwe hanglamp voor boven de eethoek en een staande lamp voor naast de nieuwe bank, waren dan ook snel gevonden.\r\n\r\nVrouwen blijven vrouwen en natuurlijk zagen zij nog wat leuke <a href=\"https://www.empelcollections.com/nl/meubels-&amp;-decoraties/meubels-en-decoraties/decoraties\" target=\"_blank\" rel=\"noopener\">decoraties</a> om het nieuwe huisje aan te kleden. En ook deze heeft <a href=\"https://www.empelcollections.com/\" target=\"_blank\" rel=\"noopener\">Empel Collections</a> genoeg.\r\n\r\nAan de basis van een succesvol eindresultaat ligt altijd een deskundig advies. Hiervan kunnen we stellen dat deze optimaal is. De eigenaar heeft ons op alle gebieden prima geholpen en geadviseerd. Bovendien stond de koffie klaar!\r\n\r\nMocht u geïnteresseerd zijn in de exclusieve collectie van <a href=\"https://www.empelcollections.com/\" target=\"_blank\" rel=\"noopener\">Empel Collections</a>, is een bezoekje aan de bijzondere <a href=\"https://www.empelcollections.com/nl/showroom\" target=\"_blank\" rel=\"noopener\">showroom</a> in Leiden zeker aan te raden. Maak van tevoren wel even een <a href=\"https://www.empelcollections.com/nl/contact\" target=\"_blank\" rel=\"noopener\">afspraak</a>!\r\n\r\n[kkstarratings]','Nieuwe inrichting','','publish','open','open','','nieuwe-inrichting','','','2018-07-12 16:52:55','2018-07-12 14:52:55','',0,'http://update.dev-atvise.nl/?p=433',0,'post','',0),(434,1,'2018-06-19 13:20:51','2018-06-19 11:20:51','','1519_020','','inherit','open','closed','','1519_020','','','2018-06-19 14:02:12','2018-06-19 12:02:12','',433,'http://update.dev-atvise.nl/wp-content/uploads/20