s</b></a>\r\n\r\n<hr />\r\n\r\n<a href=\"http://horeca.2link.be\">horeca</a> <a href=\"http://2link.be\">2Link</a>\r\n\r\n<hr />\r\n\r\n<a href=\"http://badkamer.2link.be/\">milieu</a> <a href=\"http://2link.be\">2Link</a>\r\n\r\n<hr />\r\n\r\n<a href=\"http://milieu.2link.be\">milieu</a> <a href=\"http://2link.be\">2Link</a>\r\n\r\n<hr />\r\n\r\n<a title=\"Interieur\" href=\"http://interieur.GoedBegin.nl\">Interieur</a>\r\n\r\n<hr />\r\n\r\n<a href=\"https://www.marington.nl/merken/myomy/\" target=\"_blank\" rel=\"noopener\">MYOMY</a>\r\n\r\n<hr />\r\n\r\n<a href=\"https://www.zoma-opleidingen.nl/\" target=\"_blank\" rel=\"noopener\">ZoMa Opleidingen</a>','Linktips','','inherit','closed','closed','','143-revision-v1','','','2018-06-28 15:15:10','2018-06-28 13:15:10','',143,'http://update.dev-atvise.nl/143-revision-v1/',0,'revision','',0),(447,1,'2018-06-29 08:48:13','2018-06-29 06:48:13','<strong>Hiep hiep hoera, feestje! Het lijkt wel een feest blog! Hoewel ik vind dat je je verjaardag en andere bijzonderheden altijd wel mag vieren. Bijzonderheden zoals diploma\'s, contract verlengingen, salarisverhoging, nieuwe baan, nieuwe woning, zoveel jaar een relatie, zoveel jaar bevriend, je kat die weer een mensen-jaar ouder is, met andere woorden: Alles moet eigenlijk gevierd worden wanneer de mogelijkheid daar is. Maar, (vandaar de \'hoewel\' in de derde zin) sommige situaties zijn zó bijzonder. Die verdienen dan extra aandacht. Zo ook deze situatie.</strong>\r\n\r\nAfgelopen week was het de verjaardag van mijn vader. Aangezien het normaal een persoon is die in de luwte blijft, was dat deze keer totaal niet het geval. Het leek wel alsof er een ander persoon stond. Ik vroeg mij af of het met zijn nieuwe leeftijd te maken had. Hij had namelijk de schitterende leeftijd van <span class=\"thin-font\">65 jaar bereikt. Dit betekent in zijn branche de pensioenleeftijd. Het zou kunnen dat dat er mee te maken had.</span>\r\n\r\n[caption id=\"attachment_368\" align=\"alignnone\" width=\"649\"]<img class=\"wp-image-368 size-full\" src=\"http://update.dev-atvise.nl/wp-content/uploads/2017/08/feest-1.jpg\" alt=\"feest blog\" width=\"649\" height=\"298\" /> Één groot feest  ?[/caption]\r\n\r\nMijn vader heeft een groot huis. Toen hij ging <a href=\"http://update.dev-atvise.nl/verhuizen/\" target=\"_blank\" rel=\"noopener\">verhuizen</a> heeft hij het gelijk goed gedaan. Een huis met een grote tuin, met dit soort gelegenheden komt dat erg goed uit. De tuin was schitterend aangekleed. Wij, zijn kinderen, weten precies wat hij mooi vindt, erg handig, want hij wilde het feest uit handen geven aan ons.\r\n\r\nHet was niet de bedoeling dat wij zouden gaan koken. Daardoor was er een cateringpartij die voor ons het eten verzorgde. De jongeren werden bovendien met andere lekkernijen verwend. WE gingen een <a href=\"https://www.eatdutchwaffles.nl/Stroopwafelkraam-huren\" target=\"_blank\" rel=\"noopener\">stroopwafelkraam huren</a> bij <a href=\"https://www.eatdutchwaffles.nl\" target=\"_blank\" rel=\"noopener\">EatDutchWaffles</a> en we gingen een <a href=\"http://www.dutchfoodconcepts.nl/poffertjeskraam-huren\" target=\"_blank\" rel=\"noopener\">poffertjeskraam huren</a> bij <a href=\"http://www.dutchfoodconcepts.nl/\" target=\"_blank\" rel=\"noopener\">Dutch Food Concepts</a>. Ideaal voor dit soort partijen. Aangezien we het in de middag vierde was iedereen op deze manier voorzien. Een schitterende stretchtent van <a href=\"http://www.flextent.nl\" rel=\"noopener\" target=\"_blank\">Flextent.nl</a> heeft voor de nodige schaduw gezorgd.\r\n\r\nDit feest doen we niet snel weer over. Maar voor deze keer was het een super ervaring. Een groot feest met vrienden en familie. En een vader die met pensioen kan en dit ook gedeeltelijk gaat doen. Feestjes zijn mooi. En moeten gevierd worden. Wellicht maak ik er wel een feest blog van!\r\n\r\n[kkstarratings]','Feestje!','','inherit','closed','closed','','362-revision-v1','','','2018-06-29 08:48:13','2018-06-29 06:4